(1, 1, 1, 'Delivery', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Shipments and returns</h2>\r\n<h3>Your pack shipment</h3>\r\n<p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via SHIPROCKET with tracking and drop-off without signature. If you prefer delivery byYOUR OWN DELIVERY PARTNER with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p>\r\n<p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>', 'delivery'),
(1, 2, 1, 'Delivery', 'Our terms and conditions of delivery', 'conditions, delivery, delay, shipment, pack', '<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees\n      will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>', 'delivery'),
(3, 1, 1, 'Terms and conditions of use', 'Our terms and conditions of use', 'conditions, terms, use, sell', '<h1>Disclaimer</h1>\r\n<p>Last updated: June 16, 2023</p>\r\n<h1>Interpretation and Definitions</h1>\r\n<h2>Interpretation</h2>\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n<h2>Definitions</h2>\r\n<p>For the purposes of this Disclaimer:</p>\r\n<ul>\r\n<li><strong>Company</strong> (referred to as either \"the Company\", \"We\", \"Us\" or \"Our\" in this Disclaimer) refers to Hastkala, Model Colony, Niwaru Road, Jhotwara.</li>\r\n<li><strong>Service</strong> refers to the Website.</li>\r\n<li><strong>You</strong> means the individual accessing the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</li>\r\n<li><strong>Website</strong> refers to Hastkala, accessible from <a href=\"https://www.hastkala.space\" target=\"_blank\" rel=\"noreferrer noopener\">https://www.hastkala.space</a></li>\r\n</ul>\r\n<h1>Disclaimer</h1>\r\n<p>The information contained on the Service is for general information purposes only.</p>\r\n<p>The Company assumes no responsibility for errors or omissions in the contents of the Service.</p>\r\n<p>In no event shall the Company be liable for any special, direct, indirect, consequential, or incidental damages or any damages whatsoever, whether in an action of contract, negligence or other tort, arising out of or in connection with the use of the Service or the contents of the Service. The Company reserves the right to make additions, deletions, or modifications to the contents on the Service at any time without prior notice. This Disclaimer has been created with the help of the <a href=\"https://www.termsfeed.com/disclaimer-generator/\" target=\"_blank\" rel=\"noreferrer noopener\">TermsFeed Disclaimer Generator</a>.</p>\r\n<p>The Company does not warrant that the Service is free of viruses or other harmful components.</p>\r\n<h1>External Links Disclaimer</h1>\r\n<p>The Service may contain links to external websites that are not provided or maintained by or in any way affiliated with the Company.</p>\r\n<p>Please note that the Company does not guarantee the accuracy, relevance, timeliness, or completeness of any information on these external websites.</p>\r\n<h1>Errors and Omissions Disclaimer</h1>\r\n<p>The information given by the Service is for general guidance on matters of interest only. Even if the Company takes every precaution to ensure that the content of the Service is both current and accurate, errors can occur. Plus, given the changing nature of laws, rules and regulations, there may be delays, omissions or inaccuracies in the information contained on the Service.</p>\r\n<p>The Company is not responsible for any errors or omissions, or for the results obtained from the use of this information.</p>\r\n<h1>Fair Use Disclaimer</h1>\r\n<p>The Company may use copyrighted material which has not always been specifically authorized by the copyright owner. The Company is making such material available for criticism, comment, news reporting, teaching, scholarship, or research.</p>\r\n<p>The Company believes this constitutes a \"fair use\" of any such copyrighted material as provided for in section 107 of the United States Copyright law.</p>\r\n<p>If You wish to use copyrighted material from the Service for your own purposes that go beyond fair use, You must obtain permission from the copyright owner.</p>\r\n<h1>Views Expressed Disclaimer</h1>\r\n<p>The Service may contain views and opinions which are those of the authors and do not necessarily reflect the official policy or position of any other author, agency, organization, employer or company, including the Company.</p>\r\n<p>Comments published by users are their sole responsibility and the users will take full responsibility, liability and blame for any libel or litigation that results from something written in or as a direct result of something written in a comment. The Company is not liable for any comment published by users and reserves the right to delete any comment for any reason whatsoever.</p>\r\n<h1>No Responsibility Disclaimer</h1>\r\n<p>The information on the Service is provided with the understanding that the Company is not herein engaged in rendering legal, accounting, tax, or other professional advice and services. As such, it should not be used as a substitute for consultation with professional accounting, tax, legal or other competent advisers.</p>\r\n<p>In no event shall the Company or its suppliers be liable for any special, incidental, indirect, or consequential damages whatsoever arising out of or in connection with your access or use or inability to access or use the Service.</p>\r\n<h1>\"Use at Your Own Risk\" Disclaimer</h1>\r\n<p>All information in the Service is provided \"as is\", with no guarantee of completeness, accuracy, timeliness or of the results obtained from the use of this information, and without warranty of any kind, express or implied, including, but not limited to warranties of performance, merchantability and fitness for a particular purpose.</p>\r\n<p>The Company will not be liable to You or anyone else for any decision made or action taken in reliance on the information given by the Service or for any consequential, special or similar damages, even if advised of the possibility of such damages.</p>\r\n<h1>Contact Us</h1>\r\n<p>If you have any questions about this Disclaimer, You can contact Us:</p>\r\n<ul>\r\n<li>\r\n<p>By email: admin@hastkala.space</p>\r\n</li>\r\n<li>\r\n<p>By phone number: 8079025931</p>\r\n</li>\r\n</ul>', 'terms-and-conditions-of-use'),
