(4, 1, 1, 'About us', 'Learn more about us', 'about us, informations', '<div id=\"container\">\r\n<div id=\"header\">\r\n<h1>VISION OF HASTKALA</h1>\r\n<p>It is general insight that Indian painstaking work are popular overall since hundreds of years, yet the truth of the matter is very bitter and abnormal, as there is no acclaim and acknowledgment for poor country handiwork specialists living and starving in some dim corners of the country. Because of different reasons, this extraordinary social legacy is being compromised forcibly s both from the inside and outside. This examination paper figures out various issues related with specialists participated in delivering painstaking work. The excellence and appeal of its specialties has forever been a wellspring of fascination to numerous Indian and unfamiliar travellers. The skilled craftsman could create brilliant objects of specialty from basic materials. Nonetheless, the craftsman local area faces various issues and need intercession to move along their personal satisfaction.</p>\r\n<p></p>\r\n<h2>WHAT IT MEANS AS \"HASTKALA\"</h2>\r\n<p><img src=\"https://hastkala.space/img/cms/INTROLOGO.jpg\" alt=\"\" width=\"350\" height=\"83\" style=\"margin-left:auto;margin-right:auto;\" /></p>\r\n<p>Hastkala is not just a platform to sell the handicrafts, but also to provide exposure to the craft makers and artisans. There are hundreds of government schemes which provide assistance either financially or technically but the artisans are unaware of them. We aim to provide a balanced and highly current organised database of such initiatives of the government and the private stakeholders.</p>\r\n<h2>OUR AIM IS TO WORK UPON:</h2>\r\n<h2>PRODUCTION</h2>\r\n<p> Poor technological know-how</p>\r\n<p> Infrastructure support-craft village</p>\r\n<p> Participation of artisans</p>\r\n<p> Craft wise documentation</p>\r\n<p> Organizing Exposure visit</p>\r\n<p> Demonstration cum workshop</p>\r\n<p> Government should open shops for raw materials</p>\r\n<p> Should be scientific quality control for some crafts TRAINING</p>\r\n<p> Lack of Training and awareness in Artisans</p>\r\n<p> Training centre/training camps/workshops are less</p>\r\n<p> Lack of professional training programmes</p>\r\n<p> To set up craft schools and training centres at different places</p>\r\n<p> To organize training camps</p>\r\n<p> Adequate training to artisans for sustained self-employment</p>\r\n<p> Government should arrange workshop for master craftsperson for design development and make new products.</p>\r\n<h2>DESIGN</h2>\r\n<p> Lack of knowledge</p>\r\n<p> Design registration should be done</p>\r\n<p> Skill up gradation Test marketing of the product</p>\r\n<p> Documentation and dissemination of Design</p>\r\n<p> To organize Design and Technical Development Workshop/Institutional training</p>\r\n<p> Different and various new product and designs should be introduced</p>\r\n<p> Government should set up strong rule and heavy penalties to copy of the design</p>\r\n<h2>MARKETING</h2>\r\n<p> Poor Marketing Strategies</p>\r\n<p> Participation in More melas/exhibitions</p>\r\n<p> Developing linkages between Government and non Government agencies</p>\r\n<p> To open websites and through advertisements</p>\r\n<p> Marketing should be properly organized</p>\r\n<p> Developing increase number of market complex</p>\r\n<p> Need base products</p>\r\n<p> Involvement of private and corporate house for market promotion</p>\r\n<p> To provide direct marketing facilities throughout the year</p>\r\n<h2>FINANCE</h2>\r\n<p> Un-defined wage structure</p>\r\n<p> To increase the capital base of handicrafts</p>\r\n<p> Lack of financial assistance and credit facilities</p>\r\n<p> Introduction of artisan Credit card</p>\r\n<p> Should provide old age pension to crafts men.</p>\r\n<p> Sales tax should be exempted by the government on some items</p>\r\n<p> Loan should be given in time at low interest rate</p>\r\n<p> To increase the capital base of handicrafts</p>\r\n<p> Financial assistance for export promotion activities</p>\r\n</div>\r\n</div>', 'about-us'),
