(6, 1, 1, 'Artisan Corner New', '', '', '<p>Language, Art and Culture Department, Himachal Pradesh<img src=\"https://hastkala.space/img/cms/List%20of%20government%20directories.jpg\" alt=\"\" width=\"981\" height=\"327\" /></p>\r\n<table style=\"height:1756px;\" width=\"975\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width:3%;\">\r\n<p>Sr. No.</p>\r\n</td>\r\n<td style=\"width:60%;\">\r\n<p>Ministry / Department</p>\r\n</td>\r\n<td style=\"width:55%;\">\r\n<p>Function / Use case</p>\r\n</td>\r\n<td>\r\n<p>Link</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>1</p>\r\n</td>\r\n<td>\r\n<p>Integrated Government Online Directory</p>\r\n</td>\r\n<td>\r\n<p>Official Directories, all under one roof.</p>\r\n</td>\r\n<td>\r\n<p><a href=\"https://igod.gov.in/\" target=\"_blank\" class=\"btn btn-default\" rel=\"noreferrer noopener\">Click Here</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>2</p>\r\n</td>\r\n<td>\r\n<p>Development Commissioner, Handicrafts</p>\r\n</td>\r\n<td>\r\n<p>Skill Development and Upliftment</p>\r\n</td>\r\n<td>\r\n<p><a href=\"Upliftment\" target=\"_blank\" class=\"btn btn-default\" rel=\"noreferrer noopener\">Click Here</a></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>3</p>\r\n</td>\r\n<td>Rajasthan Government Handicraft Emporium</td>\r\n<td>Rajasthan Government Handicraft</td>\r\n<td><a href=\"https://industries.rajasthan.gov.in/\" target=\"_blank\" class=\"btn btn-default\" rel=\"noreferrer noopener\">Click Here</a></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>4</p>\r\n</td>\r\n<td>Uttarakhand Handloom and Handicraft Development Council, Dehradun</td>\r\n<td>Uttarakhand Handloom and Handicraft</td>\r\n<td><a href=\"https://www.uttarakhandcrafts.com/\" target=\"_blank\" class=\"btn btn-default\" rel=\"noreferrer noopener\">Click Here</a></td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>5</p>\r\n</td>\r\n<td>Handlooms, Handicrafts and Textiles Department, Tamil Nadu<a href=\"http://www.tn.gov.in/hhtk\" class=\"search-title\" target=\"_blank\" title=\"External link that opens in a new w