(55, 1, 1, '<p>Feather soft cotton made block print fabric by yards. This fabric is hand crafted by the artisans of Rajasthan. This block print fabric by yards is available in all colors and block print floral designs. Use of vegetable dyes that are eco friendly and skin soft. You can use these in making dresses of block print fabric, napkins, dinner cloths, handkerchief, covers and wraps of block print and block print curtains and block print home decor. This Indian block print consists of floral prints that made on wooden blocks, and then dipped in dye and hand pressed on the fabric. The fabric itself is ultra light and breathable having the properties of cool nature. It is good to go with any color matching as it has plesant block printing color. Super soft and ultra light breathable block print fabric Dyed of Natural vegetable colors without any chemicals Multicolors available in block print fabric. Fabrics measured in yards, 44 inch wide Slight color variation due to hand printing COtton voile fabric, Indian block print. Dress Making, Sewing, Crafting, Napkins, Beachwears, Sarong, Pareo, Scarf/ Scarves, Kaftan, Kurtis, Tops, DIY Prjects and much more.</p>', '<p>Indian Ethnic 100% Cotton Voile Running Hand Block Print Natural Fabric for Dressmaking, Sewing, Crafting, Upholestry Fabric by The Yards</p>', 'indian-ethnic-100-cotton-voile-running-hand-block-print-natural-fabric', 'Meta description-handmade indian block print bedsheet fabric', 'meta keywords-bedsheets,bedcovers,fabric,block print', 'Meta title-handmade block print bedheet and bedcover', 'Indian Ethnic 100% Cotton Voile Running Hand Block Print Natural Fabric', 'In Stock', 'Current supply. Ordering available'),
