(80, 1, 1, '<p><strong>How to wear a Scarf Some favourite ways to tie scarves :</strong><br />Tying a scarf around the neck as you go out, whatever outfit you wear, has become the norm for many of us. A scarf is the ultimate accessory to top your ensemble. It is expected to catapult your ordinary outfit straight into the stratosphere of high fashion. It could too, if the scarf style is right </p><p><strong>Scarf wearing style 1:</strong><br />This is a classic knot style of tying the scarf. To make this knot you fold the scarf by half, keep it around the neck and take both the ends through inside the folded edge. This forms a single knot around the neck..</p><p><strong>Scarf wearing style 2-Infinity wrap style:</strong><br />Arrange the knot so that it is at the back of the neck. Your easy infinity scarf is ready.This is the easiest way to tie a scarf around the neck. You have to wrap the scarf so that the ends are towards the back, first. Then cross the ends at the back of the neck and bring the ends to the front of the body.</p><p><strong>Specility:</strong><br />Trendy Multi-Color Shawl/Wrap/Duptta/Fashion Scarve can be styled over the shoulder with any type of Dress, Blouse, Sweater, Sleeves, Jacket, Blazer or Shirt for a charming modern look. Popular for both adults, women, and teen girls. Multi-purpose accessories!</p>', '<p>This Eye Catching Forest Green Scarf perfect for a wedding party or casual.</p>', 'shawls-and-wraps-party-scarf-for-women-solid-chiffon-microsoft-green-long-girls-fashion-scarves', 'Meta description-Dupatta Scaves For Women Ethnic', 'Meta keywords- Dupatta, Scarves, Pom Pom', 'Meta title-Dupatta Scarves for Women Ethnic', 'Shawls and Wraps Party Scarf For Women Solid Chiffon Microsoft Green Long Girls Fashion Scarves', 'In Stock', 'Current supply. Ordering available'),
